import React from 'react';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import {Container, Grid} from "@material-ui/core";
import {createMuiTheme, makeStyles, ThemeProvider} from '@material-ui/core/styles';
import './Faq.scss';

interface TabPanelProps {
    children?: React.ReactNode;
    index: any;
    value: any;
}

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#5ee279',
            main: 'rgba(247, 247, 247, 0.99)',
            dark: '#007e1d',
            contrastText: '#444',
        },
        secondary: {
            main: '#1bb14c',
        },
    },

});
const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
}));

function TabPanel(props: TabPanelProps) {
    const {children, value, index, ...other} = props;

    return (
        <Typography
            component="div"
            role="tabpanel"
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && <Box p={3}>{children}</Box>}
        </Typography>
    );
}

function a11yProps(index: any) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}


export default function Faq() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
        setValue(newValue);
    };

    return (
        <Container component="main" className='faq-wrap' maxWidth="lg">
            <ThemeProvider theme={theme}>
                <Tabs value={value} onChange={handleChange} aria-label="FAQs">
                    <Tab label="1" {...a11yProps(0)} />
                    <Tab label="2" {...a11yProps(1)} />
                    <Tab label="3" {...a11yProps(2)} />
                    <Tab label="4" {...a11yProps(3)} />
                    <Tab label="5" {...a11yProps(4)} />
                    <Tab label="6" {...a11yProps(5)} />
                </Tabs>
                <TabPanel value={value} index={0}>
                    <div className={classes.root}>

                    </div>
                </TabPanel>
                <TabPanel value={value} index={1}>
                    <div className={classes.root}>

                    </div>
                </TabPanel>
            </ThemeProvider>
        </Container>
    );
}
